車種別専用カット！ドレスアップに。<br><br><br>●「マジカルカーボン・シリーズ」は炭素繊維素材、及びガラス繊維素材を特殊技術により柔軟性をもたせた国際特許申請済みの純国産の高級カーボンです。<br><br>●平織りカーボンではなく、見る角度によってその表情を変える綾織りカーボンにこだわっています。<br><br>●素材の輝きと光沢を放ちつつ、カーボンの立体感・質感が味わえ、高級感を醸し出しながらエレガンスに仕上がります。<br><br><br>【適合車種】<br>メーカー：TOYOTA/トヨタ<br>車 名：ヴォクシー<br>型 式：ZWR/ZRR80<br>年 式：2014.1～<br><br>カラー：ブラック<br>メーカー：ハセプロ<br>品番：CFWAT-7<br><br>※商品画像はイメージとなり他のカラーが使用されている場合がございますが、販売カラーはブラックとなります。<br>※車種専用のカーボンシートのみの販売となります。<br><style type="text/css">
